      <div class="Oferta__root_dETBM" data-qa-file="Oferta">Нажимая на&nbsp;кнопку «Перевести», вы соглашаетесь с&nbsp;условиями <a data-qa-file="Oferta" href="https://acdn.tinkoff.ru/static/documents/oferta-universal-c2c-payments.pdf" rel="noopener noreferrer " target="_blank" data-qa-type="uikit/link" class="Link-module__link_yQVl1 Link-module__link_theme_dark_NHnG5"><span class="Link-module__inner_gQpwp" data-qa-type="uikit/link.inner" style="outline: none;" tabindex="-1" data-qa-file="Clickable">публичной&nbsp;оферты</span></a></div>
    </div>
    <div class="Card2CardFooterInfo__info_Bbkj3" data-qa-file="Card2CardFooterInfo">Переводы между картами Тинькофф — без ограничений, с&nbsp;карты или на&nbsp;карту другого банка — до 150&nbsp;000 ₽ за&nbsp;один перевод. Возможны дополнительные ограничения со&nbsp;стороны Visa и&nbsp;Mastercard. Срок зачисления: обычно моментально, в&nbsp;редких случаях до&nbsp;1 дня. В&nbsp;других банках могут быть свои комиссии и&nbsp;лимиты на&nbsp;переводы. При переводах с&nbsp;дебетовых и&nbsp;зарплатных карт комиссии, как правило, нет. При переводах по&nbsp;номеру кредитного договора деньги зачисляются на&nbsp;текущий счет.</div>
