ders":"transfer-inner,transfer-deposit,c2c-in-new,c2c-out,c2c-anytoany,transfer-inner-third-party,transfer-inner-third-party-currency,p2p-anybank","withoutFilter":"true","smartAppBanner":false,"layoutComponent":"platform\\u002Flayouts\\u002FPlatformLayout","useVideoQRScanner":true,"meta":{"seo":{"metaTags":{"title":"Переводы с карты на карту | Перевести деньги по номеру карты","robots":"all","keywords":"Тинькофф, Tinkoff, онлайн банк, интернет банк, переводы с карты на карту, перевести деньги по номеру карты","canonical":"https:\\u002F\\u002Fwww.tinkoff.ru\\u002Fpayments\\u002Fcard-to-card\\u002F","description":"Переводы с карты на карту по номеру телефона онлайн на сайте Тинькофф. Мгновенное зачисление средств."},"shareSchema":{"openGraph":{"url":"https:\\u002F\\u002Fwww.tinkoff.ru\\u002Fpayments\\u002Fcard-to-card\\u002F","type":"website","image":"https:\\u002F\\u002Facdn.tinkoff.ru\\u002Fstatic\\u002Fpages\\u002Ffiles\\u002F8415dfe5-af9f-4474-9001-506d1fcd59ff.png","title":"Тинькофф — финансовые услуги для физических и юридических лиц","locale":"ru_RU","imageAlt":"","siteName":"Тинькофф Банк","imageType":"image\\u002Fpng","imageWidth":"1200","description":"Лучший мобильный банк в мире! По версии Global Finance — Best Digital Bank Award 2018","imageHeight":"630","imageSecure":"https:\\u002F\\u002Facdn.tinkoff.ru\\u002Fstatic\\u002Fpages\\u002Ffiles\\u002F8415dfe5-af9f-4474-9001-506d1fcd59ff.png"},"twitterCard":{"card":"summary_large_image","site":"@tinkoff_bank","image":"https:\\u002F\\u002Facdn.tinkoff.ru\\u002Fstatic\\u002Fpages\\u002Ffiles\\u002F8415dfe5-af9f-4474-9001-506d1fcd59ff.png","title":"Тинькофф — финансовые услуги для физических и юридических лиц","creator":"@tinkoff_bank","imageAlt":"","description":"Лучший мобильный банк в мире! По версии Global Finance — Best Digital Bank Award 2018"}},"structuredData":{"jsonLd":{},"microdata":{}}},"analytics":{"productCategory":"Payments"}},"content":{"content":[{"content":[],"type":"desktopFaq","version":"2.0","properties":{"panelProps":{"color":{"style":"default"}},"background":{"style":"primary"},"list":[{"title":{"text":"\\u003Cp\\u003EКак перевести деньги с карты или на карту другого банка?\\u003C\\u002Fp\\u003E","htmlTag":"div"},"description":{"text":"\\u003Cp\\u003EОнлайн-перевод денег на&nbsp;карту Тинькофф — без комиссии с&nbsp;нашей стороны. Комиссия за&nbsp;перевод с&nbsp;карты Тинькофф на&nbsp;карту другого банка — согласно тарифу по&nbsp;вашей карте Тинькофф. Другие банки могут брать комиссию за&nbsp;перевод со&nbsp;своих карт, уточняйте условия конкретного банка. За&nbsp;перевод между картами других банков взимается фиксированная комиссия 1,5%, минимум 30 ₽. Перевод денег с&nbsp;кредитной карты приравнивается к&nbsp;снятию наличных. Наш сервис по&nbsp;переводу с&nbsp;карты на&nbsp;карту работает для карт большинства банков РФ: Сбербанка, «Альфа-банка», ВТБ, «Газпромбанка», «Открытия», «Райффайзенбанка» и&nbsp;других.\\u003C\\u002Fp\\u003E","htmlTag":"div"}},{"title":{"text":"\\u003Cp\\u003EНа&nbsp;какие карты можно перевести деньги?\\u003C\\u002Fp\\u003E","htmlTag":"div"},"description":{"text":"\\u003Cp\\u003EПереводы можно делать как на дебетовые, так и на кредитные карты российских банков. Переводите на карты платежных систем Visa и Visa Electron, Mastercard и Maestro, а также «Мир». Наш сервис по переводу денежных средств с карты на карту работает для карт большинства банков РФ: Сбербанка, «Альфа-банка», ВТБ, «Газпромбанка», «Открытия», «Райффайзенбанка» и других.&nbsp;\\u003C\\u002Fp\\u003E","htmlTag":"div"}},{"title":{"text":"\\u003Cp\\u003EКакие лимиты на&nbsp;переводы с&nbsp;карту на&nbsp;карту?\\u003C\\u002Fp\\u003E","htmlTag":"div"},"description":{"text":"\\u003Cp\\u003EДо 100&nbsp;000 ₽ за&nbsp;один перевод. В&nbsp;сутки можно сделать до&nbsp;5 онлайн-переводов с&nbsp;карты на&nbsp;карту. Повышенные лимиты доступны в&nbsp;личном кабинете. Возможны дополнительные ограничения со&nbsp;стороны Visa и Mastercard. В&nbsp;других банках могут быть свои лимиты на&nbsp;переводы с&nbsp;их&nbsp;карт или на&nbsp;их&nbsp;карты — уточняйте условия конкретного банка.\\u003C\\u002Fp\\u003E","htmlTag":"div"}},{"title":{"text":"\\u003Cp\\u003EСколько времени нужно, чтобы средства поступили на&nbsp;счет?\\u003C\\u002Fp\\u003E","htmlTag":"div"},"description":{"text":"\\u003Cp\\u003EДенежные переводы между картами Тинькофф зачисляются моментально. Сроки денежных переводов с&nbsp;карты или на&nbsp;карту Сбербанка, «Альфа-банка», ВТБ, «Газпромбанка», «Открытия», «Райффайзенбанка» и&nbsp;других банков: обычно моментально, в&nbsp;редких случаях до&nbsp;1 дня.&nbsp;\\u003C\\u002Fp\\u003E","htmlTag":"div"}}],"analytics":{"componentName":"","componentProductName":"","componentProductCategory":""}},"schemaId":"ba47a68c-3825-4163-a635-6240f9dccbdc","meta":{"analytics":{"tracking":{"trackingName":"FAQ_7q5joscduwul","active":true}}},"id":"f9a3196e-3d2f-4187-ab8e-221a9749946a"}],"type":"fragment","version":"1.0","properties":{},"schemaId":"d8942924-86dc-4d56-8509-74757790a271","meta":{"analytics":{"tracking":{"active":true,"trackingName":"Вертикальный layout_izxnap6sruhi"}}},"id":"21573ab5-f023-4538-9538-00711f1499e2"}},"actualPath":"\\u002Fpayments\\u002Fcard-to-card\\u002F","params":{}},"currentUrl":{"href":"https:\\u002F\\u002Fwww.tinkoff.ru\\u002Fpayments\\u002Fcard-to-card\\u002F?internal_source=homePayments_transferList_category","origin":"https:\\u002F\\u002Fwww.tinkoff.ru","protocol":"https:","username":"","password":"","port":"","pathname":"\\u002Fpayments\\u002Fcard-to-card\\u002F","path":"\\u002Fpayments\\u002Fcard-to-card\\u002F?internal_source=homePayments_transferList_category","search":"?internal_source=homePayments_transferList_category","hash":"","query":{"internal_source":"homePayments_transferList_category"},"host":"www.tinkoff.ru","hostname":"www.tinkoff.ru"}},"module":{"modulesConfig":{"defaultPath":"www.cdn-tinkoff.ru\\u002Ffrontend-libraries\\u002F","serverPath":"www.cdn-tinkoff.ru\\u002Ffrontend-libraries\\u002F","clientP