 деньги с карты или на карту другого банка?","tagName":"h3"},"content":{"text":"Онлайн-перевод денег на карту Тинькофф — без комиссии с нашей стороны. Комиссия за перевод с карты Тинькофф на карту другого банка — согласно тарифу по вашей карте Тинькофф. Другие банки могут брать комиссию за перевод со своих карт, уточняйте условия конкретного банка. За перевод между картами других банков взимается фиксированная комиссия 1,5%, минимум 30 ₽. Перевод денег с кредитной карты приравнивается к снятию наличных. Наш сервис по переводу с карты на карту работает для карт большинства банков РФ: Сбербанка, «Альфа-банка», ВТБ, «Газпромбанка», «Открытия», «Райффайзенбанка» и других.","size":15}},{"title":{"text":"На какие карты можно перевести деньги?","tagName":"h4"},"content":{"text":"Переводы можно делать как на дебетовые, так и на кредитные карты российских банков. Переводите на карты платежных систем Visa и Visa Electron, Mastercard и Maestro, а также «Мир». Наш сервис по переводу денежных средств с карты на карту работает для карт большинства банков РФ: Сбербанка, «Альфа-банка», ВТБ, «Газпромбанка», «Открытия», «Райффайзенбанка» и других.","tagName":"span","size":15}},{"title":{"text":"Какие лимиты на переводы с карту на карту?","tagName":"h4"},"content":{"text":"До 100 000 ₽ за один перевод. В сутки можно сделать до 5 онлайн-переводов с карты на карту. Повышенные лимиты доступны в личном кабинете. Возможны дополнительные ограничения со стороны Visa и Mastercard. В других банках могут быть свои лимиты на переводы с их карт или на их карты — уточняйте условия конкретного банка.","tagName":"span","size":15}},{"title":{"text":"Сколько времени нужно, чтобы средства поступили на счет?","tagName":"h4"},"content":{"text":"Денежные переводы между картами Тинькофф зачисляются моментально. Сроки денежных переводов с карты или на карту Сбербанка, «Альфа-банка», ВТБ, «Газпромбанка», «Открытия», «Райффайзенбанка» и других банков: обычно моментально, в редких случаях до 1 дня.","size":15}}],"notAnonymous":[{"title":{"text":"Как перевести деньги с карты или на карту другого банка?","tagName":"h3"},"content":{"text":"Онлайн-перевод денег на карту Тинькофф — без комиссии с нашей стороны. Комиссия за перевод с карты Тинькофф на карту другого банка — согласно тарифу по вашей карте Тинькофф. Другие банки могут брать комиссию за перевод со своих карт, уточняйте условия конкретного банка. За перевод между картами других банков взимается фиксированная комиссия 1,5%, минимум 30 ₽. Перевод денег с кредитной карты приравнивается к снятию наличных. Наш сервис по переводу с карты на карту работает для карт большинства банков РФ: Сбербанка, «Альфа-банка», ВТБ, «Газпромбанка», «Открытия», «Райффайзенбанка» и других.","size":15}},{"title":{"text":"На какие карты можно перевести деньги?","tagName":"h4"},"content":{"text":"Переводы можно делать как на дебетовые, так и на кредитные карты российских банков. Переводите на карты платежных систем Visa и Visa Electron, Mastercard и Maestro, а также «Мир». Наш сервис по переводу денежных средств с карты на карту работает для карт большинства банков РФ: Сбербанка, «Альфа-банка», ВТБ, «Газпромбанка», «Открытия», «Райффайзенбанка» и других.","tagName":"span","size":15}},{"title":{"text":"Какие лимиты на переводы с карту на карту?","tagName":"h4"},"content":{"text":"Переводы между картами Тинькофф — без ограничений. За один перевод с карты или на карту другого банка можно перечислить до 150 000 ₽. В сутки можно сделать до 20 онлайн-переводов с карты на карту. Возможны дополнительные ограничения со стороны Visa и Mastercard. В других банках могут быть свои лимиты на переводы с их карт или на их карты — уточняйте условия конкретного банка.","tagName":"span","size":15}},{"title":{"text":"Сколько времени нужно, чтобы средства поступили на счет?","tagName":"h4"},"content":{"text":"Денежные переводы между картами Тинькофф зачисляются моментально. Сроки денежных переводов с карты или на карту Сбербанка, «Альфа-банка», ВТБ, «Газпромбанка», «Открытия», «Райффайзенбанка» и других банков: обычно моментально, в редких случаях до 1 дня.","size":15}}]},"footer":{"anonymous":{"text":"До 100 000 ₽ за один перевод. Повышенные лимиты доступны в личном кабинете. Возможны дополнительные ограничения со стороны Visa и Mastercard. Срок зачисления: обычно моментально, в редких случаях до 1 дня. В других банках могут быть свои комиссии и лимиты на переводы. При переводах с дебетовых и зарплатных карт комиссии, как правило, нет. При переводах по номеру кредитного договора деньги зачисляются на текущий счет."},"notAnonymous":{"text":"Переводы между картами Тинькофф — без ограничений, с карты или на карту другого банка — до 150 000 ₽ за один перевод. Возможны дополнительные ограничения со стороны Visa и Mastercard. Срок зачисления: обычно моментально, в редких случаях до 1 дня. В других банках могут быть свои комиссии и лимиты на переводы. При переводах с дебетовых и зарплатных карт комиссии, как правило, нет. При переводах по номеру кредитного договора деньги зачисляются на текущий счет."}}},"limits":{"ANONYMOUS":{"value":"100 000"},"NOT_ANONYMOUS":{"value":"150 000"},"transferLimits":{"anonymous":"100 000","notAnonymous":"150 000"},"RUBDebitCommission":{"transfer":"1,5%, минимум 30 ₽","renewal":"2%"},"limitBoundaries":{"minLimit":0.99,"maxLimit":1000000},"currencySourceLimits":{"providerIds":{"transfer-inner":true,"d2d-transfer":true}}}},"viewConfig":{},"regions":{"currentRegionId":"77","list":[{"parent":{"name":"г. Москва","pgId":"2","namePrepositional":"Москве","id":"77","nameGenitive":"Москвы"},"name":"г. Москва","pgId":"2","namePrepositional":"Москве","id":"77","nameGenitive":"Москвы"},{"parent":{"name":"г. Санкт-Петербург","pgId":"3","namePrepositional":"Санкт-Петербурге","id":"78","nameGenitive":"Санкт-Петербурга"},"name":"г. Санкт-Петербург","pgId":"3","namePrepositional":"Санкт-Петербурге","id":"78","nameGenitive":"Санкт-Петербурга"},{"parent":{"name":"Респ Адыгея","pgId":"4","id":"01"},"name":"Респ Адыгея"